from collections import defaultdict


class Solution:
    def longestDupSubstring(self, s: str) -> str:
        N = 3 * 10 ** 4 + 10
        n = len(s)
        b = 13131313
        MOD = 10 ** 20 + 7
        p = [0] * N
        p[0] = 1
        h = [0] * N
        for i in range(1, n + 1):
            h[i] = ((h[i - 1] * b + (ord(s[i - 1]) - ord('a')) % MOD) + MOD) % MOD
            p[i] = (p[i - 1] * b) % MOD

        def func(window_size: int) -> str:
            if window_size == 0:
                return ""
            _set=set()
            i = 1
            while i + window_size-1 <= n:
                j = i + window_size-1
                _hash = ((h[j] - h[i - 1] * p[j - i + 1]) % MOD + MOD) % MOD
                if _hash in _set:
                    return s[i-1:j]
                _set.add(_hash)
                i += 1
            return ""

        left, right = 1, n-1
        ans = ""
        while left <= right:
            mid = (left + right) >> 1
            t = func(mid)
            if t != "":
                left = mid + 1
                ans = t
            else:
                right = mid - 1
        return ans


